import { Box } from "@mui/material";
import {Items} from './Items';

export const Home = () => {
  return (
    <div style={{ width: '100%' }}>
      <Box
        sx={{
          display: 'flex',
          flexDirection: 'central',
          flexWrap: 'nowrap',
          p: 1,
          m: 1,
          bgcolor: 'background.paper',
          borderRadius: 1,
        }}
      >
       <Item>I</Item>
      </Box>
    </div>
  );
};
